import React from 'react';
import Card from 'react-bootstrap/Card';
import { propTypes } from 'prop-types';
function titles({word}) {
  return (
               <Card
      style={{
        border: 'solid 3px',
        maxWidth: 'auto',
        borderRadius: '10px',
        backgroundColor: '#C4EBFF',
      }}
    >
      <Card.Body>
        <Card.Text>
          {word}
        </Card.Text>
      </Card.Body>
    </Card>
  );
}

export default titles;
